Tanpa Efek Samping</h2></div></div><div class="elementor-element elementor-element-55a2de5f elementor-widget elementor-widget-image" data-id="55a2de5f" data-element_type="widget" data-settings="{&quot;_animation_mobile&quot;:&quot;none&quot;}" data-widget_type="image.default"><div class="elementor-widget-container"><div class="elementor-image"> <noscript><img width="500" height="508" src="https://www.yang-utama.com/wp-content/uploads/2021/03/fghfgh.jpg" class="attachment-full size-full" alt="" srcset="https://www.yang-utama.com/wp-content/uploads/2021/03/fghfgh.jpg 500w, https://www.yang-utama.com/wp-content/uploads/2021/03/fghfgh-295x300.jpg 295w" sizes="(max-width: 500px) 100vw, 500px" style="width:100%;height:101.6%;max-width:500px;" /></noscript><img width="500" height="508" src='data:image/svg+xml,%3Csvg%20xmlns=%22http://www.w3.org/2000/svg%22%20viewBox=%220%200%20500%20508%22%3E%3C/svg%3E' data-src="https://www.yang-utama.com/wp-content/uploads/2021/03/fghfgh.jpg" class="lazyload attachment-full size-full" alt="" data-srcset="https://www.yang-utama.com/wp-content/uploads/2021/03/fghfgh.jpg 500w, https://www.yang-utama.com/wp-content/uploads/2021/03/fghfgh-295x300.jpg 295w" data-sizes="(max-width: 500px) 100vw, 500px" style="width:100%;height:101.6%;max-width:500px;" /></div></div></div><div class="elementor-element elementor-element-bec7994 elementor-widget elementor-widget-text-editor" data-id="bec7994" data-element_type="widget" data-settings="{&quot;_animation_mobile&quot;:&quot;none&quot;}" data-widget_type="text-editor.default"><div class="elementor-widget-container"><div class="elementor-text-editor elementor-clearfix"><div style="text-align: left;"><ul><li><span style="color: #ffff00;"><strong>PURWOCENG (Pimpinella Alpina Herba)</strong></span> Meningkatkan jumlah hormon testosteron, sehingga dapat meningkatkan kejantanan pria, sebagai afrodisiak (Pembangkit Gairah Seksual), mengatasi masalah disfungsi seksual.<br /><br /></li><li><span style="color: #ffff00;"><strong>PASAK BUMI (Eurycoma Longifolia)</strong></span> Sebagai afrodisiak, memperbaiki dan menjaga kesuburan/kualitas sperma, pemerangkap logam pembentuk radikal bebas<br /><br /></li><li><strong><span style="color: #ffff00;">GINSENG (Panax Ginseng Radix)</span></strong> Memiliki efek adaptogen dan ergogenik, membantu tubuh menangkal stress, mampu meningkatkan kinerja fisik, meningkatkan fungsi psikologis, meningkatkan fungsi imun dan sebagai obat anti diabetik, menambah ketahanan terhadap stres, penyakit dan mencegah kelelahan, menstabilkan sistem kardiovaskular, sistem imun, sistem endokrin, dan sistem saraf<br /><br /></li><li><strong><span style="color: #ffff00;">JAHE MERAH (Zingiberis Rhizoma Var Rubrum Extract)</span></strong> Bersifat antikoagulan dan antioksidan, mencegah penggumpalan darah, sebagai afrodisiak atau menambah gairah seksual, meningkatkan libido, meningkatkan aktivitas seksual pada penggunaan jangka panjang, sehingga dapat meningkatkan /memperlama durasi hubungan seksual</li></ul></div></div></div></div></div></div></div></section><section class="elementor-section elementor-top-section elementor-element elementor-element-3e5e5ab5 elementor-section-stretched elementor-section-height-min-height elementor-section-content-middle elementor-section-boxed elementor-section-height-default elementor-section-items-middle" data-id="3e5e5ab5" data-element_type="section" data-settings="{&quot;stretch_section&quot;:&quot;section-stretched&quot;,&quot;background_background&quot;:&quot;gradient&quot;,&quot;shape_divider_top&quot;:&quot;mountains&quot;,&quot;shape_divider_bottom&quot;:&quot;drops&quot;}"><div class="elementor-shape elementor-shape-top" data-negative="false"> <svg xmlns="http://www.w3.org/2000/svg" viewbox="0 0 1000 100" preserveaspectratio="none"> <path class="elementor-shape-fill" opacity="0.33" d="M473,67.3c-203.9,88.3-263.1-34-320.3,0C66,119.1,0,59.7,0,59.7V0h1000v59.7 c0,0-62.1,26.1-94.9,29.3c-32.8,3.3-62.8-12.3-75.8-22.1C806,49.